/** @type { import('@storybook/react').Preview } */
import './../src/styles/global.scss'
import './../src/styles/global.scss'
const preview = {
  parameters: {
    controls: {
      matchers: {
        color: /(background|color)$/i,
        date: /Date$/i,
      },
    },
  },

  tags: ['autodocs']
};

export default preview;
